import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';
import welcomeImage from './images/welcome2.png';

function Welcome() {
    return (
        <div className="welcome-container">
            <div className="left-half">
                <img src={welcomeImage} alt="Library Illustration" className="full-image"/>
            </div>
            <div className="right-half">
                <div className="overlay">
                    <h1 className="company-name">EduConnect</h1>
                    <p className="description">
                        Unlock the power of learning with EduConnect, your online resource library for educational excellence.
                    </p>
                    <blockquote className="quote">
                        "Education is the most powerful weapon which you can use to change the world."
                    </blockquote>
                    <Link to="/signin">
                        <button className="sign-in-button">Sign In</button>
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
